g the concepts of theories of failure.','0','0',''),('AEF0294','18CS744 - Cryptography','Implement the various classical encryption techniques and block Cipher Encryptions. ','Apply the knowledge of number theory in Public Key Cryptography and solve various problems.','Compare the key management and distribution issues.','Demonstrate the User authentication techniques and electronics mail security in network security. ','Understand the security protocols used in IP Security.','0','William Stallings: Cryptography and Network Security, Pearson 6th edition.','0',''),('AEF03077','18ME72 - COMPUTER AIDED DESIGN & MANUFACTURING','Define Automation, CIM, CAD, CAM and explain the differences between these concepts. Solve and analyse simple problems of transformations to apply to the real world.','Explain the basics of automated manufacturing industries through mathematical models and analyze Different types of automated flow lines.','Analyse the automated flow lines to reduce time and enhance productivity.','Explain the use of different computer applications in manufacturing, and able to prepare part Program for simple jobs on CNC machine tools and robot programming.','Visualize and appreciate the modern trends in Manufacturing like additive manufacturing, Industry 4.0 and applications of Internet of Things leading to Smart Manufacturing.','0','Automation, Production Systems and Computer-Integrated Manufacturing ','CAD / CAM Principles and Applications','CAD/CAM/CIM'),('AEF03642','18CS52 - Computer Networks and Security','0','0','0','0','0','0','0','0',''),('AEF04502','18CS55 - Application Development using  Python','0','0','0','0','0','0','0','0',''),('AEF05065','18CV35 - Basic Surveying','Explain the fundamentals, principles of surveying applied to various applications in order to minimize errors with defined precision and accuracy.','Determine the measurements for different conditions using analog or digital type of instruments with their principles of working and entering in the books.','Define & apply the fundamentals to determine the angular & linear dimensions in the vertical & horizontal plane using different types of compass & theodolite.','Determine the constants for an instrument & measurements using Bowditch & Transit rule when they are having errors. ','Apply the fundamentals of leveling to find the profile of the ground with the corrections for booking using analog or digital instruments. ','Apply different mathematical formulae to compute and draw the contours, areas and volumes.','B.C. Punmia, Surveying Vol.1, Laxmi Publications pvt. Ltd., New Delhi 2009. ','S.K. Duggal, Surveying Vol.1, Tata McGraw Hill Publishing Co. Ltd. New Delhi.2009','K.R. Arora, Surveying Vol. 1 Standard Book House, New Delhi. 2010 '),('AEF05608','18CS53 - Database Management System','Understand schema and ER-models to represent simple database application scenarios','Understand and apply the basic concepts of relational data model, entity-relationship model, relational database design, relational algebra and SQL','Implement simple database systems or applications using embedded and dynamic SQL.','Create database using normalization','Understand transaction processing, concurrency control and database recovery protocols','','Fundamentals of Database Systems, Ramez Elmasri and Shamkant B. Navathe, 7th Edition, 2017, Pearson.','Database management systems, Ramakrishnan, and Gehrke, 3rd Edition, 2014, McGraw Hill','0'),('AEF05909','18CV743 - Design Concept of Building Services','0','0','0','0','0','0','1. National Building Code.',' 2. Charangith shah, Water supply and sanitary engineering, Galgotia publishers. ','3. Kamala & D L Kanth Rao, Environmental Engineering, Tata McGraw Hill publishing co. Ltd.  '),('AEF06135','18CS734 - User Interface Design',' The student will be able to :','Design the User Interface, design, menu creation, windows creation and connection between menus and windows','0','0','0','0','1. Wilbert O. Galitz, The Essential Guide to User Interface Design, John Wiley &amp;\r','Sons, Second Edition 2002.\r','0'),('AEF06370','18CS32 - Data Structures and Applications',' After studying this course, students will be able to:','CO Numbers Course Outcomes Blooms Level Target Level','18CS32.1 Use of relevant data structures which are key for designing efficient algorithmsfor array and string operations such as searching, sorting and pattern matching for the given problems. Apply (L3) 2','18CS32.2 Demonstrate the operations of stack and queues and Implementthealgorithms for stack and queue applications. Analyse(L4)','Apply(L3) 2','18CS32.3 Understanding the differences betweenSLL, DLL and CLL by its operations and Implement algorithms for its applications such as polynomials and sparse matrix. Apply(L3) 2','0','0',''),('AEF06451','18CS72 - Big Data Analytics',' The student will be able to:','Understand fundamentals of Big Data analytics.','Investigate Hadoop framework and Hadoop Distributed File system.','Illustrate the concepts of NoSQL using MongoDB and Cassandra for Big Data.','Demonstrate the MapReduce programming model to process the big data along with Hadoop tools.','Use Machine Learning algorithms for real world big data.','Raj Kamal and Preeti Saxena, Big Data Analytics Introduction to Hadoop, Spark, and Machine-Learning, McGraw Hill Education, 2018 ISBN: 9789353164966, 9353164966\r','Douglas Eadline, &quot;Hadoop 2 Quick-Start Guide: Learn the Essentials of Big Data Computing in the Apache Hadoop 2 Ecosystem&quot;, 1stEdition, Pearson Education, 2016. ISBN-\r','13: 978-9332570351\r'),('AEF4303','18CS71 - Artificial Intelligence and Machine  Learning',' The student will be able to :','Appaise the theory of Artificial intelligence and Machine Learning.','Illustrate the working of AI and ML Algorithms.','Demonstrate the applications of AI and ML.','0','0','Tom M Mitchell,Machine Lerning,1st Edition, McGraw Hill Education, 2017.\r','Elaine Rich, Kevin K and S B Nair, Artificial Inteligence, 3rd Edition, McGraw Hill Education, 2017.\r','0'),('AEF5604','17ME742 - TRIBOLOGY','Explain the fundamentals of Tribology and associated parameters.','Design simple components experiencing relative motion and performance analysis using Tribological concepts','Analyze the requirements and design hydrodynamic journal and plane slider bearings for a given application.','Select proper bearing materials and lubricants for a given Tribological application.','Apply the principles of surface engineering for different applications of Tribology','0','Introduction to Tribology, B. Bhushan, John Wiley & Sons, Inc., New York, 2002','Engineering Tribology, PrasantaSahoo, PHI Learning Private Ltd, New Delhi, 2011.','Engineering Tribology, J. A. Williams, Oxford Univ. Press, 2005. '),('AEF5604','18ME53 - DYNAMICS OF MACHINES','Analyse the mechanisms for static and dynamic equilibrium. ','Carry out the balancing of rotating and reciprocating masses. ','Analyse different types of governors used in real life situations','Analyse the gyroscopic effects on disk, airplanes, stability of ships, two and four wheelers.','Understand the free and forced vibration phenomenon','Determine the natural frequency, force and motion transmitted in vibrating system.','Theory of Machines:  Kinematics and Dynamics by Sadhu Singh','Mechanism and Machine  Theory by G. Ambedkar','Theory of Machines by Rattan S.S'),('AEFO6175','','0','0','0','0','0','0','0','0',''),('AEFO6175','18CS36 - Discrete Mathematical Structures','Understand basic connectives, mathematical logic and quantifiers  to formulate real world  problems into mathematical models  and proof them mathematically.','Apply mathematical induction,counting principles like permutation ,Combination and apply them in real world Applications.','Evaluate to use logical notations to define and reason about fundamental mathematical concepts such as sets, relations and functions ','Apply principles of inclusion and Exclusion ,formulate problems and solve recurrence relations .','Analyse to  solve real world problems using graph theory and trees concept.','','Ralph P. Grimaldi: Discrete and Combinatorial Mathematics, 5th Edition, Pearson Education, 2004','Basavaraj S Anami and Venkanna S Madalli: Discrete Mathematics - A Concept based approach, Universities Press, 2016','Kenneth H. Rosen : Discrete Mathematics and its Applications, 6th Edition, McGraw Hill, 2007');
