INSERT INTO `dept_pso` VALUES (1,'Computer Science and Engineering','Professional Skills: The ability to understand & implement the computer programs in the areas of Computer Architecture, System Software, Database Management Systems, Web Design, Multimedia and Computer Networking.                                         ','Problem-Solving Skills: The ability to solve real-world problems by the suitable mathematical model with strong technological concepts in the rapidly growing arena of computer technology.                                        ','Successful Career and Entrepreneurship: Knowledge in diverse areas of Software Engineering and Management & Entrepreneurship for IT Industry, conducive in cultivating skills for successful career development. ','0','0'),(2,'Information Science and Engineering','Design, develop, test and maintain the software systems that satisfy the needs of the IT industry.','Apply the knowledge of computer networking, database and computations to provide solutions to real-world engineering problems.','Develop programs and projects using different modern software tools for industrial & scientific applications.','0','0'),(3,'Electronics and Communication Engineering',' Understand and apply the principles of Science and Engineering in the field of Electronics and Communication.',' Ability to design and implement systems using the concepts of Analog & Digital Electronics, Communication & Networking, Signal Processing, Embedded Systems & Semiconductor technology to solve complex problems.','Develop proficiency to use modern Hardware & Software tools in the area of Electronics and Communication Engineering.','0','0'),(4,'Mechanical Engineering','Will be able to analyze, interpret and provide solutions to engineering and social problems.','Adapt to the dynamic challenges and scenario in the industries.','0','0','0'),(5,'Civil Engineering','The graduates will be able to plan, analyse, design and execute cost effective civil engineering structures without over exploitation of natural resources.','The graduates will have the ability to take up employment, entrepreneurship, research and development for sustainable civil society.','The graduates will be able to pursue opportunities for personal and professional growth, higher studies and engage in lifelong learning in civil engineering profession.','The graduates will be able to demonstrate professional integrity and an appreciation of ethical environmental, regulatory and issues related to civil engineering projects.','0'),(6,'AIML','Professional Skills: The ability to understand & implement the computer programs in the areas of Computer Architecture, System Software, Database Management Systems, Web Design, Multimedia and Computer Networking.','Problem-Solving Skills: The ability to solve real-world problems by the suitable mathematical model with strong technological concepts in the rapidly growing arena of computer technology.','Successful Career and Entrepreneurship: Knowledge in diverse areas of Software Engineering and Management & Entrepreneurship for IT Industry, conducive in cultivating skills for successful career development.','0','0');
